import React from 'react';

const Form=()=>{ 
    return (
        <form>
        <input type="text" clas="todo-input" />
        <button clas="todo-button" type="submit">
        <i clas="fas fa-plus-square"></i>
        </button>
        <div clas="select">
        <select name="todos" clas="filter-todo">
            <option value="all">All</option>
            <option value="completed">Completed</option>
            <option value="uncompleted">Uncompleted</option>
        </select>
        </div>
    </form>
    )
}

export default Form;
